svg.script:
// Pause all CSS/SMIL animations until SVG fully loaded, to avoid animation desync on slower network connections
const root = document.querySelector(':root');
root.pauseAnimations();
root.classList.add('svg-loading');

window.addEventListener('load',beginAnims);

function beginAnims() {
    root.unpauseAnimations();
    root.classList.remove('svg-loading');
}

const chocPaths = document.querySelector('#choc-paths'),
      uaRaw = window.navigator.userAgent,
      ua = new UAParser(uaRaw),
      engine = ua.getEngine().name;

if (engine == 'WebKit') {
    const root = document.querySelector(":root");
    root.classList.add('is-webkit')
    root.setCurrentTime(20); // tells SMIL to skip forward 20s in the global timeline, bypassing the intro animations. This method is both simpler and avoids a weird singular animation reset hitch for the main loop if instead removing the intro `animate` elements.

    // Remove all choc paths that aren't part of the 'empty' state
    function deleteExceptClass(node, className) {
        let nodesToKeep = findNodesWithClass(node, className),
            newParent = node.cloneNode(false);

        for (let nodeToKeep of nodesToKeep) {
            newParent.appendChild(nodeToKeep);
        }

        node.parentNode.replaceChild(newParent, node);
    }

    function findNodesWithClass(node, className) {
        let nodesToKeep = [];

        if (node.classList.contains(className)) {
            nodesToKeep.push(node);
        }

        for (let child of node.children) {
            nodesToKeep.push(...findNodesWithClass(child, className));
        }

      return nodesToKeep;
    }

    deleteExceptClass(chocPaths,'empty-group')
}

const choc = document.querySelector('.choc-present');

if (engine != 'WebKit') {
    choc.addEventListener('animationend', (e) => {
        if (event.currentTarget !== event.target) return;
        choc.remove();
    }, false);
}

// Last minute Webkit changes
// After testing live Webkit's SVG compatibility for these is so terribad/buggy I have to swap out the SVGs for a static raster

if (engine == 'WebKit') {
    const main = document.querySelector('#main-graphic'),
          stickers = document.querySelector('.stickers-wrapper'),
          wkonly = document.querySelector('.webkit-only-raster');

    main.remove();
    stickers.remove();

    let el = document.createElementNS("http://www.w3.org/2000/svg", 'image');
    el.setAttribute('href','header-webkit.png'); // inexplicably using `xlink:href` fails to render when added via JS but SVG 2's `href` syntax does
    el.setAttribute ('width','1796px');
    el.setAttribute('height','653px');
    el.classList.add('webkit-only-image');
    wkonly.appendChild(el)

    const container = document.querySelector('.webkit-only-raster-wrapper');

    function getViewportDimensions() {
        return {
            width: Math.max(
                document.documentElement.clientWidth,
                window.innerWidth || 0
            ),
            height: Math.max(
                document.documentElement.clientHeight,
                window.innerHeight || 0
            )
        };
    }

    function centerContainer() {
        const { width: viewportWidth, height: viewportHeight } = getViewportDimensions();
        container.setAttribute('x',(viewportWidth / 2) + 'px');
    }

    window.addEventListener('load', centerContainer);
    window.addEventListener('resize', centerContainer);

}
